def time2timestamp(timeStr):
    timearry = time.strptime(timeStr, "%m/%d/%Y %H:%M:%S")
    timestamp = int(time.mktime(timearry))
    return timestamp


def processData(filename):
    processedData = []
    with open(filename, 'r+', encoding='utf-8') as f:
        chunks = f.read().split("----------------------------------------")
        chunks = [x for x in chunks if x != '']
        for obj in chunks:
            chunkProcessedData = []
            if "ERROR" in obj:
                pass
            else:
                if "Source: 172.18.0.1\n" in obj:
                    chunkProcessedData.append(1)
                else:
                    chunkProcessedData.append(0)
                objLines = obj.split("\n")
                # print(objLines)
                for line in objLines:
                    if "Packet signed by" in line:
                        chunkProcessedData.append(line.split(' ')[-1])
                    if "Timestamp:" in line:
                        # time = time2timestamp(line.split(' ', 1)[-1].split('.')[0])
                        chunkProcessedData.append(line)
                    if "Packet type" in line:
                        packetType = line.split(' ')[-1]
                        chunkProcessedData.append(packetType)
                    if "Packet length:" in line:
                        packetSize = line.split(' ')[-1]
                        chunkProcessedData.append(packetSize)
            if chunkProcessedData != []:
                processedData.append(chunkProcessedData)
    processedData.pop()
    return(processedData)

